import { useState} from 'react';

const Display = (counter) => {
    return (
        <div>{counter}</div>
    )
}

const App = () => {
    const [Right, setRight] = useState(0);
    const [Left, setLeft] = useState(0);
    const RightClick = () => {
        setRight(Right + 1);
    }
    const LeftClick = () => {
        setLeft(Left+1);
    }
    return(
        <div>
            <Display counter={Left}/>
            <Display counter={Right}/>
            <button>{Left}</button>
            <button>{Right}</button>
        </div>

    )


}
